import styled from "styled-components";
import { Container, Text } from "../styledComponents";
<Avatar src={hasLogo} className={classes.small} />;

const HouseWrapper = styled(Container)`
  display: flex;
  flex-direction: column;
  /* align-items: center;
  justify-content: space-between; */
  height: 350px;
  min-width: 320px;
  border: 1px solid #d5d8dc;
  margin-bottom: 20px;
  border-radius: 2px;
  background-color: white;
  &:hover {
    box-shadow: 0 3.2px 7.2px 0 rgba(0, 0, 0, 0.132),
      0 0.6px 1.8px 0 rgba(0, 0, 0, 0.108);
  }
`;

const CardHeader = styled(Container)`
  direction: flex;
  flex-direction: row;
  padding: 8px;
  width: 100%;
  align-items: center;
  background-color: transparent;
`;
const HouseItem = () => {
  return (
    <HouseWrapper>
      <CardHeader>
        <Text>Image</Text>
        <Container flex={1} column color="transparent">
          <Text>Description</Text>
        </Container>

        <Container flex={false} color="transparent">
          <Text>Footer</Text>
        </Container>
      </CardHeader>
      <Text>Image</Text>
      <Text>Description</Text>
      <Text>Footer</Text>
    </HouseWrapper>
  );
};

export default HouseItem;
